`, 'color: hsl(199, 100%, 64%)');

		import { glyphrStudioOnLoad, GSApp, log } from './app/main.js';
		window.log = log;
		document.addEventListener('DOMContentLoaded', glyphrStudioOnLoad);
		window._GlyphrStudioApp = GSApp;

		window.closeAllDialogs = function(){
			let dialogs = document.querySelectorAll('dialog');
			// console.info(`CloseAllDialogs: ${dialogs.length}`);
			dialogs.forEach(element => element.parentElement.removeChild(element));
		}

	<style>
		body,
		#app__wrapper,
		#loadScreen {
			height: 100%;
			width: 100%;
			min-height: 100%;
			min-width: 100%;
			position: absolute;
			top: 0px;
			left: 0px;
			overflow: hidden;
		}

		#app__wrapper {
			z-index: 1;
			background-color: #161D20;
		}

		#loadScreen {
			z-index: 10;
			font-family: sans-serif;
			opacity: 1;
			visibility: visible;
			transition: opacity 500ms ease-out;
			background-color: #0E1214;
			padding: auto;
			text-align: center;
			vertical-align: middle;
		}

		#loadScreen svg,
		#loadScreen #errorMessage {
			margin: auto;
			position: relative;
			top: calc(50% - 128px);
		}

		#loadLogo {
			fill: #00344E;
			stroke: #008ACF;
			stroke-width: 1px;
			stroke-opacity: 1;
			animation-name: border-pulse;
			animation-duration: 800ms;
			animation-iteration-count: infinite;
		}

		@keyframes fill {
			0% {
				fill: #00344E;
			}
			20% {
				fill: #00283D;
			}
			100% {
				fill: #00344E;
			}
		}

		@keyframes border-pulse {
			0% {
				stroke-opacity: 1;
			}
			20% {
				stroke-opacity: 0.6;
			}
			100% {
				stroke-opacity: 1;
			}
		}
	</style>
